import React from "react";
import HeroImg from "../Assets/hero-img.png"

function Hero() {
    return (
        <div className="relative pt-16 pb-12 flex content-center justify-center">
            <div className="absolute top-0 w-full h-full bg-cover bg-center bg-hero-image"></div>
            <div className="container z-10 h-[75vh] flex content-center">
                <div>
                    <h1 className="text-green-600 text-8xl font-serif">Sprinkle & Dash</h1>
                    <p className="text-slate-500 text-2xl mt-4">Bringing dishes from around the world to your kitchen...</p>
                </div>
            </div>
        </div>
    )
}

export default Hero;
